import React from 'react';
// ../ means current folder state move to one level up (here 2 level up) 
import logo from '../../images/logo.png';
import './Header.css'


const Header = () => {
    return (
        <div className='header'>
            <img src={logo} alt="" />
        </div>
    );
};

export default Header;
